import { Link } from "react-router-dom";

const DUMMY_EVENTS=[
    {id:'e1',name:'exhibition'},
    {id:'e2',name:'inaguaration'},
    {id:'e3',name:'annual meeting'},


]

const EventsPage=()=>{
    return(
        <>
         <h1>EventsPage</h1>
         <ul>
            {DUMMY_EVENTS.map(event=>{
                <li key={event.id} > <Link></Link> </li>
            })}
         </ul>
        </>
    );
}

export default EventsPage;
